import './App.css';
import { graphql } from "@octokit/graphql";
import { useEffect } from 'react';

async function App () {
  useEffect(()=>{
    const getQl = async () => {
      const graphqlWithAuth = graphql.defaults({
        headers: {
          authorization: `token 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`,
        },
      });
      const { repository } = await graphqlWithAuth(`
        {
          repository(owner: "octokit", name: "graphql.js") {
            issues(last: 3) {
              edges {
                node {
                  title
                }
              }
            }
          }
        }
      `);
      console.log(repository);
    }

    getQl();
  },[]);

  return (
    <div className="App">
      {repository}
    </div>
  );
}

export default App;
